(54,'',26,1679519835,1679318099,0,0,0,0,'',256,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_position\":\"\",\"date\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"tx_content_animation\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"categories\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'textmedia','Hébergement','','<p>Ce site est hébergé par o2switch<br /> 222-224 Boulevard Gustave Flaubert<br /> 63000 Clermont-Ferrand<br /> SARL o2switch au capital de 7500€<br /> RCS : Clermont-Ferrand – SIRET : 510 909 80700016 – TVA : FR35510909807<br /> La marque o2switch est déposée INPI sous le numéro 09 3 645 729.</p>',0,0,0,0,0,0,0,2,0,0,20,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(55,'',24,1737123456,1679318390,0,0,0,0,'',256,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"tx_content_animation\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'thbck_3cols','Qui suis-je ?','','J\'exerce mon activité d\'éducateur canin depuis 2008 et j\'ai été formée par le Dr Simon Nathalie, vétérinaire comportementaliste, à la conduite accompagnée du chien.',0,0,0,0,1,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(56,'',24,1737123365,1679318659,0,0,0,0,'',128,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"tx_content_animation\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'thbck_formes','Méthode','','<p>J\'utilise une méthode d\'éducation globale, qui prend en compte la race de votre chien et ses paramètres environnementaux (conditions de vie, composition de la famille,...)</p>\r\n<p>Quand on prend un chien, il est très important de respecter ses besoins et de les faire coincider avec les envies de la famille.</p>\r\n<p>Je vous accompagne dans l\'apprentissage de l\'éducation de votre chien de façon personnalisée.</p>\r\n<p>Mon intervention vous permettra de créer une vie harmonieuse avec votre chien.</p>\r\n<p>Votre chien sera à l\'écoute de tous les membres de la famille, peu importe l\'age.</p>\r\n<p>Dans l\'éducation d\'un chien, il est interdit d\'utiliser la force, la menace, les colliers électriques,....</p>',0,0,0,0,1,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(57,'',24,1737123496,1679318676,0,0,0,0,'',512,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"header\":\"\",\"thbck_squares_tabs_item\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"tx_content_animation\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'thbck_squares','Mes compétences','','',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(60,'',39,1725435927,1679321891,0,0,0,0,'',256,0,0,0,0,NULL,'{\"hidden\":\"\"}',0,0,0,0,'textmedia','Les séances de médiation avec le cheval permettent :','','<ul><li>de reprendre de l\'espace</li><li>de diminuer une souffrance en créant du bien être</li><li>de se recentrer sur soi et ressortir ses émotions</li><li>le cheval est très sensible aux émotions des personnes et réagit vite</li><li>le cheval nous permet de retrouver les sensations que l\'on ressentait bébé, sensation d\'apaisement (le toucher, l\'odeur, la chaleur, le bercement)</li><li>d\'apporter un état de bien être</li><li>de retrouver de l\'estime de soi</li><li>de libérer la parole et d\'encourager la communication</li></ul>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(67,'',35,1679322195,1679322195,0,0,0,0,'',256,0,0,0,0,NULL,'',0,0,0,0,'textmedia','','','<p>Cette discipline consiste à créer une cohésion entre le maître et son chien.</p>\r\n<p>Cela reste de l\'agility mais l\'on procède de façon ralenti, on cherche à stabiliser le chien pour diminuer les départs incontrôlés sur les joggeurs, cyclistes,.....</p>\r\n<p>Cette discipline se pratique avec un chien en liberté, il doit attendre le code pour passer l\'obstacle.</p>\r\n<p>En appliquant cette méthode, vous obtiendrez un chien à l\'écoute, un chien stable.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(69,'',37,1679474814,1679322234,0,0,0,0,'',256,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_position\":\"\",\"date\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"tx_content_animation\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"categories\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'textmedia','','','<p>En fonction de l\'âge de votre chien et des difficultés rencontrés, on peut parler de prévention, de rattrapage ou de rééducation.</p>\r\n<p><strong>La 1ere séance</strong>, se déroule à votre domicile. Nous évaluons ensemble les besoins de votre chien et vos envies.</p>\r\n<p>Lors du rdv, tous les membres de la famille doivent être présent afin de mettre en place la stratégie éducative qui correspond à votre chien. Ce rdv se déroule sur 2h environ.</p>\r\n<p>En évoluant au sein de votre famille, à votre domicile, je suis plus à même de vous conseiller et de vous accompagner.</p>\r\n<p>Dans les séances suivantes, nous mettrons en pratique, chez vous, dans différents lieux,....</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(70,'',38,1679322254,1679322254,0,0,0,0,'',256,0,0,0,0,NULL,'',0,0,0,0,'textmedia','','','<p>Le pistage est une discipline permettant au chien de se concentrer sur une odeur et de diminuer son impulsivités visuelle.</p>\r\n<p>Elle est très intérressante pour des races telles que le malinois, le border collie, le berger australien,...et bien d\'autres, qui ont une sensibilités visuelle beaucoup plus marqués.</p>\r\n<p>Dans cette discipline le chien évolue soit libre soit en longe de 10 mètres, il doit retrouver un objet ou suivre une odeur ou chercher une balle parmis d\'autres objets,...</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
