(72,'',34,1737123788,1679343239,0,0,0,0,'',128,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"tx_content_animation\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'thbck_formes','','','<p>Cette discipline consiste à créer une cohésion entre le maître et son chien. Cela reste de l\'agility mais l\'on procède de façon ralenti, on cherche à stabiliser le chien pour diminuer les départs incontrôlés sur les joggeurs, cyclistes,.....</p>\r\n<p>Elle se pratique avec le chien en liberté, il doit attendre le code pour passer l\'obstacle. En appliquant cette méthode, vous obtiendrez un chien à l\'écoute, un chien stable.</p>',0,0,0,0,1,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(73,'',33,1713277891,1679410574,0,0,0,0,'',128,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"tx_mask_col_color\":\"\",\"image\":\"\",\"header\":\"\",\"bodytext\":\"\",\"tx_mask_text1\":\"\",\"tx_mask_text2\":\"\",\"tx_mask_color_col\":\"\",\"tx_mask_text3\":\"\",\"tx_mask_image_col\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"tx_content_animation\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"categories\":\"\",\"rowDescription\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\"}',0,0,0,0,'mask_educcanine_3_cols_colors','','','<p>Avant chaque séance d’éducation, <strong>laisser votre chien se défouler quelques minutes</strong>, il n’en sera que plus réceptif.</p>\r\n<p>La 1ere séance, <strong>se déroule chez vous</strong>. Nous évaluons ensemble vos besoins et vos attentes : en évoluant au sein de votre famille, je peux mieux vous conseiller et élaborer le programme d’éducation</p>',0,0,0,0,1,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(74,'',36,1684136776,1679473893,0,0,0,0,'',128,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"header\":\"\",\"bodytext\":\"\",\"image\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"tx_content_animation\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"categories\":\"\",\"rowDescription\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\"}',0,0,0,0,'mask_educcanine_3_cols_full_width','Les cours collectifs se déroulent sur différents environnements : plage,  forêt,.....','','<p>J\'organise des séances avec 4 chiens maximum pour travailler dans les meilleures conditions&nbsp;: la socialisation, la stabilité, le jeux structuré, la marche en laisse, le rappel,... tout ce qui est indispensable pour vivre avec un chien agréable.</p>\r\n<p>Tous les chiens présents au cours collectifs <a href=\"t3://page?uid=37\">ont été suivis en individuel</a> auparavant.<br />Le chien est beaucoup plus réceptif à l\'apprentissage s\'il est seul.</p>\r\n<p>Les cours sont dispensés le samedi après midi, tous les 15 jours et quasiment tous les mercredis. N\'hésitez pas à me <a href=\"t3://page?uid=31\">contacter</a> pour connaître les prochaines dates.</p>',0,0,0,0,1,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(75,'',28,1737123708,1679474848,0,0,0,0,'',128,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"tx_content_animation\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'thbck_formes','','','<p><strong>Loi 20 juin 2008 (chiens 1ere et 2eme catégorie)</strong></p>\r\n<p><strong>Cette formation est basée sur l\'éducation et le comportement canin.</strong></p>\r\n<p>Cette formation de 7 heures, vous permettra d\'obtenir l\'attestation d\'aptitude.</p>\r\n<p>Cette attestation ainsi que l\'évaluation comportementale délivrée par un vétérinaire habilité, vous sera réclamée à la mairie en vue d\'obtenir votre permis de détention.<br /><br />La journée de formation peut se dérouler à votre domicile.</p>',0,0,0,0,0,0,0,2,0,1,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
