(80,'',30,1679496131,1679496118,0,0,0,0,'',1024,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_position\":\"\",\"date\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"tx_content_animation\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"categories\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'textmedia','','','<p><em>Pas de supplément kilométriques dans un rayon de 20km autour de Grand Champ, au-delà, 50 cts du km supplémentaire</em></p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(81,'',40,1684136831,1679500632,0,0,0,0,'',128,0,0,0,0,NULL,'{\"CType\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"tx_content_animation\":\"\"}',0,0,0,0,'mask_educcanine_3_cols_full_width','Intervention en maison de retraite','','<p class=\"title_green\">Je me déplace avec mes chiens, pour partager des moments de bonheur avec les résidents.</p>\r\n<p>Le chien permet d\'optimiser leur développement social, affectif et moteur.</p>\r\n<p>Le contact avec le chien apaise et valorise la personne.&nbsp;&nbsp; &nbsp;</p>\r\n<p>L\'objectif de cette démarche est d\'apporter un bien-être, de développer leur dextérité, de stimuler leurs capacités cognitives et de maintenir une certaine autonomie.</p>',0,0,0,0,1,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(82,'',40,1684136841,1679500698,0,0,0,0,'',192,0,0,0,0,NULL,'{\"CType\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"tx_content_animation\":\"\"}',0,0,0,0,'mask_educcanine_3_cols_full_width','Intervention dans les écoles, centre de loisirs','','<p>J\'interviens auprès des enfants en difficultés (phobie des chiens, phobie scolaire, autisme…) et des adultes (dépression, stress, phobie des chiens, ...) afin de leur expliquer comment fonctionne les chiens, comment parler aux chiens pour qu\'ils nous comprennent.</p>\r\n<p>Je souhaite faire évoluer les mentalités sur la place du chien dans notre société.</p>\r\n<p>Cette formation permet à l\'enfant d\'apprendre le respect de l\'autre, les responsabilités qu\'entraîne l\'adoption d\'un chien, d\'augmenter l\'estime de l\'enfant grâce à son implication auprès du chien,....</p>',0,0,0,0,1,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
