(93,'',7,1706197168,1706195821,0,0,0,0,'',128,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_position\":\"\",\"date\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"tx_content_animation\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"categories\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'textmedia','','','<p>Nous sommes fiers de vous offrir notre expertise dans la construction de piscines, de l\'implantation initiale à la mise en eau finale.</p>\r\n<h2>Conception Personnalisée</h2>\r\n<p>Nous travaillons en étroite collaboration avec vous pour concevoir une piscine qui répond parfaitement à vos envies. Nous prenons en compte les dimensions du terrain, vos besoins et les fonctionnalités désirées pour créer un projet personnalisé.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','mb-3',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
