(96,'',7,1706197150,1706197150,0,0,0,0,'',448,0,0,0,0,NULL,'',0,0,0,0,'textmedia','Accompagnement','','<p>Notre équipe sera présente à vos côtés lors de la mise en eau. Bien que les machines actuelles sachent parfaitement gérer la qualité de votre eau automatiquement, nous vous expliquerons comment surveiller votre piscine pour qu\'elle conserve une eau propre toute l\'année.</p>\r\n<p>À la fin de la saison, nous viendrons vous expliquer les différentes solutions d\'hivernage : actif ou passif</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','mb-3',NULL,NULL,0,'','',0,2,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(97,'',7,1706197184,1706197184,0,0,0,0,'',320,0,0,0,0,NULL,'',0,0,0,0,'textmedia','Nous nous occupons de tout','','<p>Le terrassement, la maçonnerie, la mise en place du local technique et l\'électricité : tout est géré entièrement pas notre équipe. C\'est bien plus simple pour vous, vous avez un seul interlocuteur !</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','mb-3',NULL,NULL,0,'','',0,2,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
