(103,'',44,1726495075,1722408304,0,0,0,0,'',256,0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"tx_container_parent\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_position\":\"\",\"date\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"image_shadow\":\"\",\"image_rounded\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"tx_content_animation\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"categories\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'textmedia','','','<blockquote><p>AdGuard n\'est pas qu\'un bloqueur de pub, mais un logiciel qui combine le blocage des pubs avec la protection des données personnelles. Notre but, c\'est de rendre aux utilisateurs le contrôle de leurs appareils et de leur expérience en ligne. Au final, nous planifions de couvrir tous les types d\'appareils, non seulement les plateformes les plus populaires.</p></blockquote>\r\n<p>AdGuard est un logiciel destiné à bloquer les publicités et à protéger la vie privée des utilisateurs sur Internet. Il existe sous plusieurs formes : extensions pour navigateurs web, applications pour ordinateurs et appareils mobiles, ainsi qu\'une version pour routeurs.</p>\r\n<h2>Principales fonctionnalités d\'AdGuard</h2>\r\n<ol><li>Blocage des publicités :<br>AdGuard empêche l\'affichage des publicités en ligne, y compris les bannières, les pop-ups, et les publicités vidéo, permettant ainsi une navigation plus rapide et sans interruptions.</li><li>Protection de la vie privée :<br>Il bloque les trackers et les outils de collecte de données qui surveillent les activités en ligne des utilisateurs, assurant une meilleure protection de la vie privée.</li><li>Filtrage du contenu :<br>AdGuard permet de configurer des filtres pour bloquer l\'accès à certains types de contenu ou sites web indésirables, ce qui peut être particulièrement utile pour les parents souhaitant protéger leurs enfants.</li><li>Sécurité de navigation :<br>Il offre une protection contre les sites web malveillants, le phishing et autres menaces en ligne, avertissant les utilisateurs lorsqu\'ils essaient d\'accéder à des sites potentiellement dangereux.</li><li>Interface conviviale et personnalisation :<br>AdGuard propose une interface utilisateur facile à utiliser et permet une personnalisation avancée des filtres et des règles de blocage, offrant aux utilisateurs la possibilité d\'ajuster le logiciel selon leurs préférences.</li></ol>\r\n<h2>Versions et compatibilité</h2>\r\n<ul><li>Extensions pour navigateurs : Disponibles pour Chrome, Firefox, Edge, Safari, etc.</li><li>Applications de bureau : Compatibles avec Windows et macOS.</li><li>Applications mobiles : Disponibles pour Android et iOS.</li><li>Version pour routeurs : Permet de protéger tous les appareils connectés au réseau domestique en bloquant les publicités au niveau du routeur.</li></ul>\r\n<p>AdGuard se distingue par sa capacité à fonctionner sur plusieurs niveaux de l\'expérience de navigation, offrant ainsi une solution complète pour ceux qui cherchent à améliorer leur confort de navigation et à renforcer leur sécurité en ligne.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(104,'',45,1722408488,1722408347,0,0,0,0,'',256,0,0,0,0,NULL,'{\"colPos\":\"\",\"sys_language_uid\":\"\",\"tx_container_parent\":\"\"}',0,0,0,0,'text','','','<p>Bitwarden est un gestionnaire de mots de passe open-source qui aide les utilisateurs à stocker et à gérer leurs mots de passe et autres informations sensibles de manière sécurisée. Voici un aperçu de ses principales fonctionnalités et avantages :</p>\r\n<h2>Fonctionnalités principales de Bitwarden</h2>\r\n<ol><li>Stockage sécurisé des mots de passe :<br>Bitwarden permet de stocker de manière sécurisée les mots de passe, les notes sécurisées, les informations de carte de crédit et d\'autres données sensibles en les cryptant avec un chiffrement AES-256 bits, l\'un des standards de sécurité les plus robustes.</li><li>Générateur de mots de passe :<br>Il inclut un générateur de mots de passe qui peut créer des mots de passe forts et uniques pour chaque compte, réduisant ainsi le risque de compromission des comptes.</li><li>Synchro multi-plateformes :<br>Bitwarden synchronise les mots de passe et autres informations sensibles sur tous les appareils de l\'utilisateur, y compris les ordinateurs de bureau (Windows, macOS, Linux), les smartphones (iOS, Android) et via des extensions pour navigateurs (Chrome, Firefox, Edge, Safari, etc.).</li><li>Autocomplétion :<br>Les extensions de navigateur et les applications mobiles de Bitwarden peuvent remplir automatiquement les champs de connexion, facilitant ainsi l\'accès aux comptes en ligne.</li><li>Partage sécurisé :<br>Il permet de partager des mots de passe ou d\'autres informations sensibles avec d\'autres utilisateurs de manière sécurisée, ce qui est particulièrement utile pour les familles ou les équipes de travail.</li><li>Authentification à deux facteurs (2FA) :<br>Bitwarden prend en charge l\'authentification à deux facteurs pour ajouter une couche supplémentaire de sécurité lors de l\'accès au coffre-fort.</li><li>Open-source :<br>Le fait que Bitwarden soit open-source signifie que son code source est disponible pour que les utilisateurs et les experts en sécurité puissent l\'examiner, garantissant une transparence et une confiance accrues dans sa sécurité.</li></ol>\r\n<h2>Versions et compatibilité</h2>\r\n<ul><li>Applications de bureau : Compatibles avec Windows, macOS, et Linux.</li><li>Applications mobiles : Disponibles pour Android et iOS.</li><li>Extensions de navigateur : Disponibles pour Chrome, Firefox, Safari, Edge, Brave, et d\'autres navigateurs populaires.</li><li>Interface web : Accès via tout navigateur web.</li></ul>\r\n<h2>Avantages de Bitwarden</h2>\r\n<ul><li>Sécurité renforcée : Grâce à son chiffrement de bout en bout et à son support pour 2FA.</li><li>Accessibilité : Les utilisateurs peuvent accéder à leurs mots de passe et autres informations de manière pratique sur tous leurs appareils.</li><li>Coût : Bitwarden propose une version gratuite avec des fonctionnalités robustes, ainsi que des options premium à coût modique pour des fonctionnalités supplémentaires.</li><li>Communauté et support : Étant open-source, Bitwarden bénéficie d\'une large communauté de contributeurs et de développeurs qui travaillent à améliorer continuellement le logiciel.</li></ul>\r\n<p>En résumé, Bitwarden est une solution puissante et sécurisée pour la gestion des mots de passe, idéale pour les utilisateurs individuels et les entreprises cherchant à protéger leurs informations sensibles.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
