(141,'',59,1722409198,1722409198,0,0,0,0,'',512,0,0,0,0,NULL,'',0,0,0,0,'text','','','<p>Tautulli est une application de surveillance et de gestion conçue spécifiquement pour Plex Media Server. Elle permet aux utilisateurs de surveiller l\'activité de leur serveur Plex, de suivre les statistiques d\'utilisation, et d\'envoyer des notifications sur divers événements. Tautulli est un outil précieux pour les administrateurs de serveurs Plex qui souhaitent avoir une vue détaillée et un contrôle sur la manière dont leur serveur est utilisé. Voici un aperçu détaillé de ses fonctionnalités et avantages :</p>\r\n<h2>Fonctionnalités principales de Tautulli</h2>\r\n<ol><li>Surveillance en temps réel :<br>Permet de surveiller en temps réel les activités sur le serveur Plex, y compris les flux en cours, les utilisateurs connectés, et les médias en cours de lecture.</li><li>Statistiques détaillées :<br>Fournit des statistiques détaillées sur l\'utilisation du serveur Plex, telles que les médias les plus regardés, le temps de visionnage total, les habitudes de visionnage par utilisateur, et bien plus encore.</li><li>Notifications et alertes :<br>Envoie des notifications sur divers événements, comme le début ou la fin d\'une lecture, des erreurs de lecture, ou l\'ajout de nouveaux médias. Les notifications peuvent être envoyées par email, via des applications de messagerie, ou intégrées avec des services comme Discord et Slack.</li><li>Rapports personnalisés :<br>Génère des rapports personnalisés sur l\'utilisation du serveur Plex, permettant aux administrateurs de voir des informations spécifiques sur l\'activité du serveur sur des périodes définies.</li><li>Historique de lecture :<br>Maintient un historique complet des lectures, y compris des détails sur les utilisateurs, les appareils utilisés, les résolutions de lecture, et les temps de début et de fin.</li><li>Gestion des utilisateurs :<br>Offre des outils pour gérer les utilisateurs du serveur Plex, y compris la possibilité de suivre les activités des utilisateurs individuels, de limiter les accès, et de surveiller les performances de lecture.</li><li>Interface utilisateur conviviale :<br>Dispose d\'une interface web intuitive et conviviale, facilitant la navigation et l\'utilisation des diverses fonctionnalités de surveillance et de gestion.</li><li>Personnalisation et extensions :<br>Permet une personnalisation étendue et l\'ajout d\'extensions pour adapter l\'outil aux besoins spécifiques de l\'utilisateur, y compris des scripts personnalisés pour des notifications et des actions spécifiques.</li></ol>\r\n<h2>Avantages de Tautulli</h2>\r\n<ul><li>Surveillance proactive :<br>En permettant une surveillance en temps réel et des notifications automatiques, Tautulli aide les administrateurs à être proactifs dans la gestion de leur serveur Plex, en résolvant les problèmes rapidement et en optimisant les performances.</li><li>Insights détaillés :<br>Les statistiques détaillées et les rapports personnalisés offrent des insights précieux sur la manière dont le serveur Plex est utilisé, aidant à prendre des décisions éclairées sur la gestion des contenus et des utilisateurs.</li><li>Amélioration de l\'expérience utilisateur :<br>En surveillant les habitudes de visionnage et les performances, Tautulli aide à améliorer l\'expérience des utilisateurs du serveur Plex, en ajustant les contenus et les paramètres selon leurs préférences et besoins.</li><li>Gestion efficace des utilisateurs :<br>Les outils de gestion des utilisateurs permettent de contrôler et de suivre les activités des utilisateurs individuels, garantissant une utilisation équitable et sécurisée du serveur Plex.</li><li>Personnalisation et flexibilité :<br>La possibilité de personnaliser les notifications, les rapports, et d\'ajouter des extensions fait de Tautulli un outil flexible qui peut être adapté aux besoins spécifiques de chaque administrateur de serveur Plex.</li></ul>\r\n<h2>Cas d\'utilisation typiques</h2>\r\n<ul><li>Administrateurs de serveurs Plex : Pour ceux qui gèrent des serveurs Plex pour des amis, la famille ou des communautés, Tautulli permet de surveiller l\'activité et de gérer les utilisateurs de manière efficace.</li><li>Utilisateurs passionnés de Plex : Pour les utilisateurs individuels qui souhaitent optimiser leur expérience Plex en surveillant les performances et en comprenant mieux leurs habitudes de visionnage.</li><li>Petites entreprises et organisations : Pour les entreprises qui utilisent Plex pour la distribution de contenu interne, Tautulli offre des outils de surveillance et de gestion essentiels pour garantir une utilisation optimale.</li></ul>\r\n<p>En résumé, Tautulli est un outil puissant et flexible pour la surveillance et la gestion de Plex Media Server, offrant une gamme complète de fonctionnalités pour suivre l\'activité, gérer les utilisateurs, et optimiser l\'expérience de visionnage.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(142,'',60,1722409213,1722409213,0,0,0,0,'',256,0,0,0,0,NULL,'',0,0,0,0,'text','','','<p>Site officiel : <a class=\"is-external-link\" href=\"https://www.ui.com/software/\">https://www.ui.com/software/</a><br />Docker Hub: <a class=\"is-external-link\" href=\"https://hub.docker.com/r/linuxserver/unifi-controller/\">https://hub.docker.com/r/linuxserver/unifi-controller/</a><br />Github: <a class=\"is-external-link\" href=\"https://github.com/linuxserver/docker-unifi-controller/\">https://github.com/linuxserver/docker-unifi-controller/</a></p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
(143,'',60,1722409236,1722409236,0,0,0,0,'',512,0,0,0,0,NULL,'',0,0,0,0,'text','','','<p>Unifi Controller est un logiciel de gestion de réseau développé par Ubiquiti Networks pour administrer et configurer les équipements réseau de la gamme UniFi. Il permet aux administrateurs de gérer de manière centralisée les points d\'accès sans fil (AP), les switches, les routeurs, les caméras de sécurité, et d\'autres dispositifs UniFi. Voici un aperçu détaillé de ses fonctionnalités et avantages :</p>\r\n<h2>Fonctionnalités principales du Unifi Controller</h2>\r\n<ol><li>Gestion centralisée :<br>Permet de gérer et configurer tous les équipements UniFi depuis une interface web unique, facilitant la gestion des réseaux complexes.</li><li>Tableau de bord intuitif :<br>Offre un tableau de bord centralisé et intuitif, fournissant une vue d\'ensemble des performances du réseau, des appareils connectés, des alertes, et des événements récents.</li><li>Configuration des points d\'accès Wi-Fi :<br>Configure et optimise les paramètres des points d\'accès sans fil, tels que les canaux, les puissances d\'émission, les SSID, la sécurité, et les VLANs.</li><li>Surveillance et analyse en temps réel :<br>Surveille les performances du réseau en temps réel, affiche des statistiques détaillées sur l\'utilisation de la bande passante, la qualité du signal, le trafic, et les appareils connectés.</li><li>Gestion des réseaux invités :<br>Crée et gère des réseaux invités avec des politiques d\'accès spécifiques, garantissant la sécurité et l\'isolation du réseau principal.</li><li>Mises à jour automatiques :<br>Gère les mises à jour de firmware et de logiciels pour tous les dispositifs UniFi, assurant que le réseau utilise les dernières fonctionnalités et correctifs de sécurité.</li><li>Alertes et notifications :<br>Envoie des alertes et des notifications sur les problèmes de réseau, les connexions et déconnexions d\'appareils, et d\'autres événements importants.</li><li>Support multi-sites :<br>Gère plusieurs sites ou réseaux à partir d\'une seule instance de contrôleur, idéal pour les entreprises multi-sites ou les fournisseurs de services gérés (MSP).</li><li>Sécurité réseau avancée :<br>Offre des fonctionnalités de sécurité avancées telles que le contrôle d\'accès, les pare-feux, les VPN, et la détection d\'intrusion.</li><li>Rapports détaillés :<br>Génère des rapports détaillés sur les performances du réseau, l\'utilisation de la bande passante, et les appareils connectés, aidant à l\'analyse et à l\'optimisation du réseau.</li></ol>\r\n<h2>Avantages du Unifi Controller</h2>\r\n<ul><li>Facilité de gestion :<br>Simplifie la gestion des réseaux complexes grâce à une interface centralisée et conviviale, réduisant le besoin de configurations manuelles sur chaque appareil.</li><li>Évolutivité :<br>Permet de gérer facilement des réseaux de toute taille, des petites installations domestiques aux grands réseaux d\'entreprise, en ajoutant simplement des dispositifs supplémentaires au besoin.</li><li>Optimisation des performances :<br>Les outils d\'analyse et de surveillance aident à identifier et résoudre les problèmes de réseau, à optimiser la couverture Wi-Fi et à assurer une performance réseau optimale.</li><li>Sécurité renforcée :<br>Offre des fonctionnalités de sécurité robustes pour protéger le réseau contre les menaces et garantir la confidentialité des données.</li><li>Flexibilité et contrôle :<br>Permet une configuration détaillée et personnalisée des dispositifs réseau, offrant un contrôle total sur la gestion et l\'optimisation du réseau.</li></ul>\r\n<h2>Cas d\'utilisation typiques</h2>\r\n<ul><li>Entreprises et bureaux : Pour gérer les réseaux internes de manière centralisée, assurer une couverture Wi-Fi optimale et garantir la sécurité des données.</li><li>Écoles et universités : Pour fournir une connectivité fiable et sécurisée aux étudiants et au personnel, tout en gérant plusieurs points d\'accès et réseaux invités.</li><li>Hôtels et lieux publics : Pour offrir un accès Wi-Fi aux clients tout en séparant les réseaux invités et internes, et en surveillant l\'utilisation de la bande passante.</li><li>Maisons intelligentes : Pour les particuliers qui souhaitent une gestion avancée et centralisée de leurs réseaux domestiques, avec des fonctionnalités de sécurité et de surveillance.</li><li>Fournisseurs de services gérés (MSP) : Pour gérer les réseaux de plusieurs clients à partir d\'une seule instance de contrôleur, simplifiant ainsi la gestion et le support.</li></ul>\r\n<p>En résumé, le Unifi Controller est un outil puissant et flexible pour la gestion centralisée des réseaux UniFi, offrant une large gamme de fonctionnalités pour optimiser, sécuriser et surveiller les réseaux de toutes tailles.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
